script: |
  super -f text -I q11374.spq | sort > q11374.out

inputs:
  - name: q11374.spq
    data: |
      SELECT - ( + + 33 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col1 / + + col1 * - - col2 = + + col1 * + col0;
  - name: tab0

outputs:
  - name: q11374.out
    data: |
      -33
      -33
      -33
